INSERT INTO films VALUES
	(DEFAULT,'The Whole Nine Yards', 'Девять ярдов', 'Дантист Николас Озерански вёл спокойную и размеренную жизнь. Но знакомство с новым соседом Джимми Тюльпаном положило ей конец раз и навсегда. Тюльпан был профессиональным убийцей и украл у своего босса десять миллионов долларов. А жена Николаса - Софи - решила сдать Джимми его бывшему боссу.','2000-02-17','США'),
	(DEFAULT,'300', '300 спартанцев','События картины повествуют о кровопролитной битве при Фермопилах в 480 году до н.э., в которой триста отважных спартанцев во главе со своим царем Леонидом преградили путь многотысячной армии персидского царя Ксеркса. Несмотря на численный перевес персов, спартанцы продолжали упорную оборону, проявив мужество и отвагу. Их бесстрашие и героизм вдохновили всю Грецию на объединение против непобедимого врага, переломив тем самым ход Греко-персидских войн…','2006-12-09','США'),
	(DEFAULT,NULL,'Особенности национальной охоты', 'Молодой финский специалист по охоте, «финик», уговаривает своего русского друга помочь ему поучаствовать в настоящей русской охоте, дабы познакомиться с нравами и привычками русских охотников.','1995-09-08','Россия'),
	(DEFAULT,'Rush Hour','Час пик','В Лос-Анджелесе злодеи похищают малолетнюю дочь китайского консула, которую в Гонконге учил кунг-фу инспектор Ли. Консул вызывает Ли в Америку, чтобы тот принял участие в освобождении девочки.','1998-09-19','США'),
	(DEFAULT,'Despicable Me','Гадкий я','Гадкий снаружи, но добрый внутри Грю намерен, тем не менее, закрепить за собой статус главного архизлодея в мире, для чего он решает выкрасть Луну при помощи созданной им армии миньонов. Дело осложняют конкуренты, вставляющие высокотехнические палки в колеса, и семейные обстоятельства в виде трех сироток, о которых Грю вынужден заботиться.','2010-06-27','США'),
	(DEFAULT,'RocknRolla','Рок-н-рольщик','Опасный мир коррупции и жизни криминальных отбросов Лондона, где недвижимость потеснила такого лидера торгового рынка как наркотики, а самыми активными предпринимателями стали преступные группировки. Но каждому, кто хочет проворачивать там свои дела, будь то мелкая сошка Раз-Два или русский теневой миллиардер Юрий Омович, придется сначала договориться с одним человеком – Ленни Коулом.','2008-09-04','США'),
	(DEFAULT,'Ace Ventura: Pet Detective','Эйс Вентура: Розыск домашних животных','Он - лучший в своем деле, единственный и неповторимый! Он - Эйс Вентура, детектив по розыску домашних любимцев. Когда таинственные злоумышленники похищают дельфина по кличке Снежинка, талисман местной футбольной команды «Дельфины», Эйс тут же приступает к работе, проявляя чудеса изобретательности.','1994-02-04','США'),
	(DEFAULT,'The Fifth Element','Пятый элемент','Каждые пять тысяч лет открываются двери между измерениями и темные силы стремятся нарушить существующую гармонию. Каждые пять тысяч лет Вселенной нужен герой, способный противостоять этому злу. XXIII век. Нью-йоркский таксист Корбен Даллас должен решить глобальную задачу - спасение всего рода человеческого.','1997-05-07','США'),
	(DEFAULT,'Yes Man','Всегда говори «ДА»','Депрессивный главный герой всегда и всем говорил «нет» — например, друзьям, если они зовут куда-то. Но в один прекрасный день он заключает соглашение, по которому всегда должен отвечать «Да» на любое предложение...','2008-12-09','США'),
	(DEFAULT,'The Hitchhiker\'s Guide to the Galaxy','Автостопом по галактике','В один прекрасный день над Землей нависли огромные звездолеты инопланетян, и людям объявили, что их родная планета подлежит сносу, а на ее месте будет проложено шикарное межзвездное шоссе. Н-да, не повезло человечеству. Кроме самого заурядного парня по имени Артур Дент, старый друг и собутыльник которого Форд Префект оказался... инопланетянином!','2005-04-20','Великобритания'),
	(DEFAULT,'Office Space','Офисное пространство','Питер Гиббонс после неудачного сеанса гипноза становится человеком с поменявшимися жизненными взглядами. Его новая философия — «забей на работу». Если он и показывается теперь в офисе, то только для того, чтобы играть в компьютерные игры, нарушать внутренний распорядок, а также говорить своему боссу, куда тому следует засунуть свои идиотские распоряжения. Но подобные действия, как ни странно, только поднимают его авторитет, зарплату и должность. Используя новые возможности, он разрабатывает схему присвоения чужих денег.','1999-02-19','США');
